import React, { useState } from 'react';
import GameScene from './GameScene';
import levels from './levels';
import './App.css';

function App() {
  const [coins, setCoins] = useState(140);

  return (
    <div className="App">
      <header className="App-header">
        <h2 className="coins">Coins: {coins}</h2>
        {levels.map((element, key) => (
          <div>
            <h1 className="level-num">{key + 1}.)</h1>
            {console.log(element.solution)}
            <GameScene
              targets={element.targets}
              nums={element.nums}
              limit={element.limit}
              solution={element.solution}

              coins={coins}
              setCoins={setCoins}
            />
          </div>
        ))}

      </header>
    </div>
  );
}

export default App;
